import './App.css';
import React, { useState } from 'react';


function App() {

  const [data,setData] = useState(null)

  fetch("/").then((res)=> res.json()).then((data)=> setData(data.message))

  return (
    <div className="App">

    <p>{!data ? "Loading...": data}</p>

    </div>
  );
}

export default App;
